import React, { useState } from 'react';
import PatientInfo from './PatientReport'; // Import the new component
import {
    TextField,
    Button,
    Container,
    Typography,
    Grid,
    Select,
    MenuItem,
    InputLabel,
    FormControl,
    Dialog,
    DialogTitle,
    DialogContent,
    DialogActions,
} from '@mui/material';

const RegistrationForm = () => {
    const [formData, setFormData] = useState({
        nome_completo: '',
        sexo: '',
        email: '',
        celular: '',
    });

    const [showWelcomeMessage, setShowWelcomeMessage] = useState(true);
    const [patientData, setPatientData] = useState(null); // Track patient data

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            const response = await fetch('http://127.0.0.1:8000/api/cadastrar-paciente', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(formData),
            });

            if (response.ok) {
                const responseData = await response.json();
                console.log('Patient registered successfully:', responseData);

                const { numero_atendimento } = responseData;

                // Dynamically set the URL for redirection
                const patientResponse = await fetch(`http://127.0.0.1:8000/api/pacientes/${numero_atendimento}`);
                const patientData = await patientResponse.json();
                setPatientData(patientData);
            } else {
                console.error('Failed to register patient');
                // Handle the error, e.g., display an error message to the user
            }
        } catch (error) {
            console.error('Error:', error);
            // Handle error
        }
    };

    const handleWelcomeMessageClose = () => {
        setShowWelcomeMessage(false);
    };

    return (
        <Container maxWidth="sm">
            {showWelcomeMessage && (
                <Dialog open={showWelcomeMessage} onClose={handleWelcomeMessageClose}>
                    <DialogTitle>Bem-vindo admin</DialogTitle>
                    <DialogContent>
                        <Typography>
                            Você está no perfil de administrador. Você tem todas as permissões para criar pacientes, registros e puxar relatórios
                        </Typography>
                    </DialogContent>
                    <DialogActions>
                        <Button onClick={handleWelcomeMessageClose} color="primary">
                            Ok
                        </Button>
                    </DialogActions>
                </Dialog>
            )}

            {patientData ? (
                <PatientInfo patientData={patientData} />
            ) : (
                <form onSubmit={handleSubmit}>
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                            <TextField
                                fullWidth
                                label="Nome Completo"
                                name="nome_completo"
                                value={formData.nome_completo}
                                onChange={handleInputChange}
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <FormControl fullWidth>
                                <InputLabel>Gênero</InputLabel>
                                <Select
                                    name="sexo"
                                    value={formData.sexo}
                                    onChange={handleInputChange}
                                    label="Gênero"
                                >
                                    <MenuItem value="">Selecione o seu Gênero</MenuItem>
                                    <MenuItem value="M">Masculino</MenuItem>
                                    <MenuItem value="F">Feminino</MenuItem>
                                    <MenuItem value="O">Outro</MenuItem>
                                </Select>
                            </FormControl>
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                fullWidth
                                label="Email"
                                name="email"
                                value={formData.email}
                                onChange={handleInputChange}
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                fullWidth
                                label="Celular"
                                name="celular"
                                value={formData.celular}
                                onChange={handleInputChange}
                            />
                        </Grid>
                    </Grid>
                    <Button type="submit" variant="contained" color="primary" style={{ marginTop: '20px' }}>
                        Cadastrar paciente
                    </Button>
                </form>
            )}
        </Container>
    );
};

export default RegistrationForm;
